/*Table structure for table `cms_article` */

DROP TABLE IF EXISTS `cms_article`;

CREATE TABLE `cms_article` (
  `id` bigint(32) NOT NULL COMMENT '文件ID',
  `title` varchar(200) NOT NULL DEFAULT '' COMMENT '文章标题',
  `image` varchar(500) DEFAULT NULL COMMENT '图片url',
  `content` text NOT NULL COMMENT '文件内容',
  `view_count` int(11) DEFAULT '0' COMMENT '浏览数',
  `order_num` int(11) NOT NULL AUTO_INCREMENT COMMENT '排序',
  `status` int(2) DEFAULT '1' COMMENT '状态',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_id` bigint(32) DEFAULT NULL COMMENT '编辑人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `category_id` bigint(32) NOT NULL COMMENT '类别Id',
  `is_delete` int(2) DEFAULT NULL,
  `update_id` bigint(32) DEFAULT NULL,
  `author` varchar(100) NOT NULL COMMENT '作者',
  `publish_time` datetime NOT NULL COMMENT '发布时间',
  `commentable` int(2) DEFAULT NULL COMMENT '能否评价',
  `attachment` varchar(500) DEFAULT NULL COMMENT '附件地址',
  PRIMARY KEY (`id`),
  KEY `order_num` (`order_num`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='文章管理';

