(1071992838584217601,'富文本编辑器Ueditor如何在Vue中使用？','/static/file/image/20181218/201812181009594770.gif','<p style=\"text-align:center\"><img src=\"http://p1.img.cctvpic.com/cportal/img/2018/12/9/1544357578515_987_1080x718.jpg\" width=\"500\"/></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;新华社北京12月10日电\n \n12月10日，纪念《世界人权宣言》发表70周年座谈会在京举行。中共中央总书记、国家主席习近平发来贺信，强调《世界人权宣言》是人类文明发展史上具有重大意义的文献，对世界人权事业发展产生了深刻影响。中国人民愿同各国人民一道，秉持和平、发展、公平、正义、民主、自由的人类共同价值，维护人的尊严和权利，推动形成更加公正、合理、包容的全球人权治理，共同构建人类命运共同体，开创世界美好未来。<br/></p><p>　　习近平在贺信中指出，人民幸福生活是最大的人权。中国共产党从诞生那一天起，就把为人民谋幸福、为人类谋发展作为奋斗目标。中华人民共和国成立近70年特别是改革开放40年来，中华民族迎来了从站起来、富起来到强起来的伟大飞跃。中国发展成就归结到一点，就是亿万中国人民生活日益改善。</p><p>　　习近平强调，时代在发展，人权在进步。中国坚持把人权的普遍性原则和当代实际相结合，走符合国情的人权发展道路，奉行以人民为中心的人权理念，把生存权、发展权作为首要的基本人权，协调增进全体人民的经济、政治、社会、文化、环境权利，努力维护社会公平正义，促进人的全面发展。</p><p>　　习近平要求，我国人权研究工作者要与时俱进、守正创新，为丰富人类文明多样性、推进世界人权事业发展作出更大贡献。</p><p>　　中共中央政治局委员、中宣部部长黄坤明在座谈会上宣读了习近平的贺信并讲话。他说，习近平总书记的贺信深刻阐述了中国共产党的人权观，为新时代中国人权事业发展指明了方向。要认真学习贯彻习近平总书记重要指示精神，讲好中国人权故事，深化人权理论研究，促进人权领域交流，扎实做好尊重和保障人权各项工作。</p><p>　　中国人权研究会会长向巴平措、中国人权发展基金会理事长黄孟复在座谈会上发言。</p><p>　　纪念《世界人权宣言》发表70周年座谈会由中国人权研究会和中国人权发展基金会共同举办。来自国家人权行动计划联席会议机制成员单位有关负责人和人权专家学者等约150人出席座谈会。</p><p><br/></p>',0,4,1,'2018-12-10 04:59:44',1071411720515293185,'2018-12-10 04:59:44',1072061292595068929,1,1071411720515293185,'龙锦兵','2018-11-01 04:12:20',1,NULL),
