/*Table structure for table `health_test_result` */

DROP TABLE IF EXISTS `health_test_result`;

CREATE TABLE `health_test_result` (
  `id` bigint(32) NOT NULL,
  `user_id` bigint(32) DEFAULT NULL COMMENT '用户id',
  `username` varchar(50) DEFAULT NULL COMMENT '姓名',
  `phone` varchar(20) DEFAULT NULL COMMENT '联系方式',
  `sex` int(2) DEFAULT NULL COMMENT '性别',
  `health_id` bigint(32) DEFAULT NULL COMMENT '体质id',
  `create_time` datetime DEFAULT NULL COMMENT '测试时间',
  `create_id` bigint(32) DEFAULT NULL COMMENT '创建者',
  `is_delete` int(2) DEFAULT NULL,
  `status` int(2) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_id` bigint(32) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='体质测试结果';

