/*Table structure for table `shop_ad` */

DROP TABLE IF EXISTS `shop_ad`;

CREATE TABLE `shop_ad` (
  `id` bigint(32) NOT NULL,
  `ad_position_id` bigint(32) NOT NULL DEFAULT '0' COMMENT '位置',
  `media_type` int(2) NOT NULL DEFAULT '0' COMMENT '媒体类型',
  `name` varchar(60) DEFAULT '' COMMENT '名称',
  `link` varchar(255) DEFAULT '' COMMENT '链接',
  `image_url` text COMMENT '图片',
  `content` varchar(255) DEFAULT '' COMMENT '内容',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `is_delete` int(2) DEFAULT NULL,
  `status` int(2) DEFAULT NULL,
  `create_id` bigint(32) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_id` bigint(32) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='促销广告';

/*Data for the table `shop_ad` */

/*Table structure for table `shop_ad_position` */

DROP TABLE IF EXISTS `shop_ad_position`;

CREATE TABLE `shop_ad_position` (
  `id` bigint(32) NOT NULL,
  `name` varchar(60) NOT NULL DEFAULT '''' COMMENT '名称',
  `width` bigint(32) NOT NULL DEFAULT '0' COMMENT '宽度',
  `height` bigint(32) NOT NULL DEFAULT '0' COMMENT '高度',
  `desc` varchar(255) NOT NULL DEFAULT '' COMMENT '描述',
  `is_delete` int(2) DEFAULT NULL,
  `status` int(2) DEFAULT NULL,
  `create_id` bigint(32) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_id` bigint(32) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='广告位置';

/*Data for the table `shop_ad_position` */

/*Table structure for table `shop_address` */

DROP TABLE IF EXISTS `shop_address`;

CREATE TABLE `shop_address` (
  `id` bigint(32) NOT NULL,
  `user_id` bigint(32) DEFAULT '0' COMMENT '会员ID',
  `user_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '收货人姓名',
  `tel_number` varchar(60) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '手机',
  `postal_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '邮编',
  `national_code` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '收货地址国家码',
  `province_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '省',
  `city_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '市',
  `county_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '区',
  `detail_info` varchar(120) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '详细收货地址信息',
  `is_delete` int(2) DEFAULT NULL,
  `status` int(2) DEFAULT NULL,
  `create_id` bigint(32) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_id` bigint(32) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='用户地址';

/*Data for the table `shop_address` */

/*Table structure for table `shop_brand` */

DROP TABLE IF EXISTS `shop_brand`;

CREATE TABLE `shop_brand` (
  `id` bigint(32) NOT NULL COMMENT '主键',
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '品牌名称',
  `list_pic_url` varchar(255) NOT NULL DEFAULT '' COMMENT '图片',
  `simple_desc` varchar(255) NOT NULL DEFAULT '' COMMENT '描述',
  `image_url` varchar(255) NOT NULL DEFAULT '' COMMENT '图片',
  `floor_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '价格',
  `app_list_pic_url` varchar(255) NOT NULL DEFAULT '' COMMENT 'app显示图片',
  `is_new` int(2) NOT NULL DEFAULT '0' COMMENT '新品牌',
  `new_pic_url` varchar(255) NOT NULL DEFAULT '' COMMENT '图片',
  `order_num` int(2) NOT NULL DEFAULT '10' COMMENT '排序',
  `is_delete` int(2) DEFAULT NULL,
  `status` int(2) DEFAULT NULL,
  `create_id` bigint(32) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_id` bigint(32) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
