/*Table structure for table `shop_order` */

DROP TABLE IF EXISTS `shop_order`;

CREATE TABLE `shop_order` (
  `id` bigint(32) NOT NULL,
  `order_sn` varchar(32) DEFAULT '' COMMENT '商品SN',
  `user_id` bigint(32) DEFAULT '0',
  `shipping_status` int(2) DEFAULT '0' COMMENT '邮寄状态',
  `consignee` varchar(60) DEFAULT '' COMMENT '收货人',
  `country` varchar(50) DEFAULT NULL COMMENT '国家',
  `province` varchar(50) DEFAULT NULL COMMENT '省',
  `city` varchar(50) DEFAULT NULL COMMENT '市',
  `district` varchar(50) DEFAULT NULL COMMENT '区',
  `address` varchar(255) DEFAULT '' COMMENT '详细地址',
  `phone` varchar(60) DEFAULT '' COMMENT '手机',
  `postscript` varchar(255) DEFAULT '' COMMENT '邮编',
  `shipping_id` int(2) DEFAULT '0' COMMENT '快递编号',
  `shipping_name` varchar(120) DEFAULT '' COMMENT '快递名称',
  `pay_id` varchar(64) DEFAULT '0' COMMENT '支付ID',
  `pay_name` varchar(120) DEFAULT '' COMMENT '支付名称',
  `shipping_fee` decimal(10,2) DEFAULT '0.00' COMMENT '邮费',
  `actual_price` decimal(10,2) DEFAULT '0.00' COMMENT '实际需要支付的金额',
  `integral` int(10) DEFAULT '0' COMMENT '合计',
  `integral_money` decimal(10,2) DEFAULT '0.00' COMMENT '总价',
  `order_price` decimal(10,2) DEFAULT '0.00' COMMENT '订单总价',
  `goods_price` decimal(10,2) DEFAULT '0.00' COMMENT '商品总价',
  `confirm_time` datetime DEFAULT NULL COMMENT '确认时间',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `freight_price` int(10) DEFAULT '0' COMMENT '配送费用',
  `coupon_id` bigint(32) DEFAULT '0' COMMENT '使用的优惠券id',
  `parent_id` bigint(32) DEFAULT '0',
  `coupon_price` decimal(10,2) DEFAULT NULL,
  `callback_status` enum('true','false') DEFAULT 'true',
  `shipping_no` varchar(32) DEFAULT NULL,
  `full_cut_price` decimal(10,2) DEFAULT NULL,
  `order_type` varchar(1) DEFAULT NULL,
  `is_delete` int(2) DEFAULT NULL,
  `status` int(2) DEFAULT NULL,
  `create_id` bigint(32) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_id` bigint(32) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单管理';

