/*Table structure for table `sys_dept` */

DROP TABLE IF EXISTS `sys_dept`;

CREATE TABLE `sys_dept` (
  `id` bigint(32) NOT NULL,
  `parent_id` bigint(32) DEFAULT NULL COMMENT '上级部门',
  `remark` varchar(500) DEFAULT NULL COMMENT '职责',
  `name` varchar(50) DEFAULT NULL COMMENT '部门名称',
  `contact_name` varchar(50) DEFAULT NULL COMMENT '负责人',
  `contact_phone` varchar(20) DEFAULT NULL COMMENT '电话',
  `order_num` int(11) NOT NULL AUTO_INCREMENT COMMENT '排序',
  `is_delete` int(2) DEFAULT '1' COMMENT '是否删除',
  `create_id` bigint(32) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_id` bigint(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `order_num` (`order_num`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='部门管理';

