/*Table structure for table `sys_log` */

DROP TABLE IF EXISTS `sys_log`;

CREATE TABLE `sys_log` (
  `id` bigint(32) NOT NULL,
  `operation` varchar(50) DEFAULT NULL COMMENT '用户操作',
  `method` varchar(200) DEFAULT NULL COMMENT '请求方法',
  `params` varchar(5000) DEFAULT NULL COMMENT '请求参数',
  `is_delete` int(2) DEFAULT '1' COMMENT '是否删除',
  `ip` varchar(64) DEFAULT NULL COMMENT 'IP地址',
  `create_id` bigint(32) DEFAULT NULL COMMENT '用户名',
  `create_time` datetime DEFAULT NULL COMMENT '发生时间',
  `update_time` datetime DEFAULT NULL COMMENT '操作时间',
  `update_id` bigint(32) DEFAULT NULL COMMENT '操作人',
  `url` varchar(256) DEFAULT NULL COMMENT 'URL',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  `level` int(4) DEFAULT NULL COMMENT '级别',
  `error_stack` text COMMENT '错误堆栈信息',
  `status` int(4) DEFAULT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统日志';

