/*Table structure for table `sys_login_log` */

DROP TABLE IF EXISTS `sys_login_log`;

CREATE TABLE `sys_login_log` (
  `id` bigint(32) NOT NULL,
  `status` int(4) DEFAULT NULL COMMENT '用户状态',
  `ip` varchar(64) DEFAULT NULL COMMENT 'IP地址',
  `create_id` bigint(32) DEFAULT NULL COMMENT '用户名称',
  `create_time` datetime DEFAULT NULL COMMENT '登录时间',
  `update_id` bigint(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `device` varchar(256) DEFAULT NULL COMMENT '登陆来源',
  `is_delete` int(2) DEFAULT '1' COMMENT '是否删除',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  `result` varchar(128) DEFAULT NULL COMMENT '结果',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='登录日志';

/*Data for the table `sys_login_log` */

/*Table structure for table `sys_menu` */

DROP TABLE IF EXISTS `sys_menu`;

CREATE TABLE `sys_menu` (
  `id` bigint(32) NOT NULL,
  `parent_id` bigint(32) DEFAULT NULL COMMENT '上级菜单',
  `name` varchar(50) DEFAULT NULL COMMENT '菜单名称',
  `url` varchar(200) DEFAULT NULL COMMENT '菜单URL',
  `type` tinyint(2) DEFAULT NULL COMMENT '类型',
  `icon` varchar(50) DEFAULT NULL COMMENT '菜单图标',
  `order_num` int(11) NOT NULL AUTO_INCREMENT COMMENT '排序',
  `status` int(2) DEFAULT NULL COMMENT '状态',
  `is_delete` int(2) DEFAULT '1' COMMENT '是否删除',
  `create_id` bigint(32) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_id` bigint(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `order_num` (`order_num`)
) ENGINE=InnoDB AUTO_INCREMENT=2887 DEFAULT CHARSET=utf8 COMMENT='菜单管理';

/*Data for the table `sys_menu` */

