/*Table structure for table `sys_sms_log` */

DROP TABLE IF EXISTS `sys_sms_log`;

CREATE TABLE `sys_sms_log` (
  `id` bigint(32) NOT NULL COMMENT '主键',
  `create_id` bigint(32) DEFAULT NULL COMMENT '操作人',
  `content` text COLLATE utf8_unicode_ci NOT NULL COMMENT '短信内容',
  `phone` text COLLATE utf8_unicode_ci NOT NULL COMMENT '接收方',
  `create_time` datetime DEFAULT NULL COMMENT '发送时间',
  `sign` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '用户签名',
  `type` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '类型',
  `extno` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '扩展码',
  `status` bigint(32) DEFAULT NULL COMMENT '发送状态',
  `send_id` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '发送编号',
  `invalid_num` bigint(32) DEFAULT NULL COMMENT '失败数量',
  `success_num` bigint(32) DEFAULT NULL COMMENT '失败数量',
  `black_num` bigint(32) DEFAULT NULL COMMENT '黑名单数',
  `return_msg` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '返回消息',
  `is_delete` int(2) DEFAULT NULL COMMENT '是否删除',
  `update_id` bigint(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='短信日志';

/*Data for the table `sys_sms_log` */

/*Table structure for table `sys_token` */

DROP TABLE IF EXISTS `sys_token`;

CREATE TABLE `sys_token` (
  `id` bigint(32) NOT NULL COMMENT '编号',
  `expire_time` datetime DEFAULT NULL COMMENT '过期时间',
  `create_time` datetime DEFAULT NULL COMMENT '登录时间',
  `ticket` varchar(128) DEFAULT NULL COMMENT '票据',
  `create_id` bigint(32) DEFAULT NULL COMMENT '用户名',
  `remark` varchar(256) NOT NULL COMMENT '备注',
  `ip` varchar(64) NOT NULL COMMENT 'IP地址',
  `principle` varchar(512) DEFAULT NULL COMMENT '授权',
  `is_delete` int(2) DEFAULT '1' COMMENT '是否删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='在线用户';

/*Data for the table `sys_token` */

/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `id` bigint(32) NOT NULL COMMENT 'Id',
  `username` varchar(50) DEFAULT NULL COMMENT '用户名',
  `nickname` varchar(50) DEFAULT NULL COMMENT '昵称',
  `name` varchar(50) DEFAULT NULL COMMENT '姓名',
  `password` varchar(256) DEFAULT NULL COMMENT '密码',
  `email` varchar(20) DEFAULT NULL COMMENT '邮箱',
  `phone` varchar(20) DEFAULT NULL COMMENT '手机号',
  `status` int(2) DEFAULT NULL COMMENT '状态',
  `is_delete` int(2) DEFAULT '1' COMMENT '是否删除',
  `create_id` bigint(32) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_id` bigint(32) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `code` varchar(20) DEFAULT NULL COMMENT '编号',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统用户';

